import React from 'react';
import { MemberCard } from './MemberCard.js';
import { EventGoalCard } from './EventGoalCard.js';
import '../../css/footer.css';


const Footer = () => {
  let totalMemberCards = 6;
  let memberCardLefts = Array(totalMemberCards).map((curr, index)=>{
    let randomLeft = Math.floor(Math.random()*10 - 5) + ((index + 1)*(100/6));
    return (
      <MemberCard left={randomLeft}/>
    )
  });

  return (
    <div>
      <EventGoalCard type="event" />
      <EventGoalCard type="event" />
      <EventGoalCard type="event" />
      <EventGoalCard type="goal" />
      <EventGoalCard type="goal" />
      <EventGoalCard type="goal" />
      {memberCardLefts}
    </div>
  )
}

export default Footer;
